import { createRoot } from "react-dom/client";

import Header from "./components/header";
import ToDoList from "./components/todo-list";
import ToDoListItem from "./components/todo-list-item";
import "./index.css";

const ToDoApp = () => {
  const todoData = [
    { discription: "Completed task", created: "created 17 seconds ago", id: 1 },
    { discription: "Editing task", created: "created 5 minutes ago", id: 2 },
    { discription: "Completed task", created: "created 17 seconds ago", id: 3 },
  ];
  return (
    <section className="todoapp">
      <Header />
      <ToDoList />
      <section className="main"></section>
    </section>
  );
};

const section = document.getElementById("root");
const root = createRoot(section);
